#include <bits/stdc++.h>

using namespace std;

typedef uint8_t BYTE;
typedef uint16_t U16;
typedef uint32_t U32;
typedef int32_t S32;
typedef uint64_t U64;
typedef uintptr_t uptrval;

#define LASTLITERALS 5
#define ML_BITS 4
#define MFLIMIT 12
#define MINMATCH 4

#define LZ4_memmove __builtin_memmove

unsigned LZ4_isLittleEndian(void) {
  const union {
    U32 u;
    BYTE c[4];
  } one = {1};
  return one.c[0];
}

U16 LZ4_read16(const void* memPtr) { return *(const U16*)memPtr; }

U16 LZ4_readLE16(const void* memPtr) {
  if (LZ4_isLittleEndian()) {
    return LZ4_read16(memPtr);
  } else {
    const BYTE* p = (const BYTE*)memPtr;
    return (U16)((U16)p[0] | (p[1] << 8));
  }
}

size_t read_long_length_no_check(const BYTE** pp) {
  size_t b, l = 0;
  do {
    b = **pp;
    (*pp)++;
    l += b;
  } while (b == 255);
  return l;
}

int LZ4_decompress_unsafe_generic(
    const BYTE* const istart,
    BYTE* const ostart,
    int decompressedSize,
    size_t prefixSize,
    const BYTE* const dictStart,
    const size_t dictSize) {
  const BYTE* ip = istart;
  BYTE* op = (BYTE*)ostart;
  BYTE* const oend = ostart + decompressedSize;
  const BYTE* const prefixStart = ostart - prefixSize;
  while (1) {
    unsigned token = *ip++;
    {
      size_t ll = token >> ML_BITS;
      if (ll == 15) {
        ll += read_long_length_no_check(&ip);
      }
      if ((size_t)(oend - op) < ll) return -1;
      LZ4_memmove(op, ip, ll);
      op += ll;
      ip += ll;
      if ((size_t)(oend - op) < MFLIMIT) {
        if (op == oend) break;
        return -1;
      }
    }
    {
      size_t ml = token & 15;
      size_t const offset = LZ4_readLE16(ip);
      ip += 2;
      if (ml == 15) {
        ml += read_long_length_no_check(&ip);
      }
      ml += MINMATCH;
      if ((size_t)(oend - op) < ml) return -1;
      {
        const BYTE* match = op - offset;
        if (offset > (size_t)(op - prefixStart) + dictSize) {
          return -1;
        }
        if (offset > (size_t)(op - prefixStart)) {
          const BYTE* const dictEnd = dictStart + dictSize;
          const BYTE* extMatch = dictEnd - (offset - (size_t)(op - prefixStart));
          size_t const extml = (size_t)(dictEnd - extMatch);
          if (extml > ml) {
            LZ4_memmove(op, extMatch, ml);
            op += ml;
            ml = 0;
          } else {
            LZ4_memmove(op, extMatch, extml);
            op += extml;
            ml -= extml;
          }
          match = prefixStart;
        }
        {
          size_t u;
          for (u = 0; u < ml; u++) {
            op[u] = match[u];
          }
        }
      }
      op += ml;
      if ((size_t)(oend - op) < LASTLITERALS) {
        return -1;
      }
    }
  }
  return (int)(ip - istart);
}

int LZ4_decompress_fast(const char* source, char* dest, int originalSize) {
  return LZ4_decompress_unsafe_generic(
      (const BYTE*)source, (BYTE*)dest, originalSize,
      0, NULL, 0);
}

constexpr const char kBase64[] =
    "ABCDEFGHIJKLMNOPQRSTUVWXYZ"
    "abcdefghijklmnopqrstuvwxyz"
    "0123456789+/";

void DecodeBase64(const char* in, int sz, char* out) {
  int T[256] = {};
  memset(T, -1, sizeof(T));
  for (int i = 0; i < 64; i++)
    T[kBase64[i]] = i;

  int val = 0, valb = -8;
  auto it = out;
  for (int i = 0; i < sz; i++) {
    uint8_t c = in[i];
    if (T[c] == -1) break;
    val = (val << 6) + T[c];
    valb += 6;
    if (valb >= 0) {
      *it++ = (val >> valb) & 0xFF;
      valb -= 8;
    }
  }
}

