#pragma pack(push, 1)
struct Node {
  Node() : out(0), nxt{} {}

  bool out;
  uint16_t cnt;
  uint16_t nxt[26];
};
#pragma pack(pop)

constexpr int kMax = 64946;
Node nodes[kMax + 1];
vector<int> edges[26];
int board[25];

int Find(int u, int node, int visited) {
  int b = 1 << u;
  if (visited & b) return 0;
  visited |= b;

  int cut = 0;
  if (nodes[node].out) {
    nodes[node].out = false;
    ++cut;
  }

  for (auto v : edges[u]) {
    int nxt = nodes[node].nxt[board[v]];
    if (nxt == 0) continue;

    cut += Find(v, nxt, visited);
    if (nodes[nxt].cnt == 0) nodes[node].nxt[board[v]] = 0;
  }
  nodes[node].cnt -= cut;

  return cut;
}

int main() {
  ios::sync_with_stdio(false);
  cin.tie(nullptr);

  char* table = (char*)malloc(337923);
  table[337922] = '\0';
  DecodeBase64(kTable, sizeof(kTable) - 1, table);
  LZ4_decompress_fast(table, (char*)nodes, sizeof(nodes));

  for (int i = 0; i < 5; i++) {
    for (int j = 0; j < 5; j++) {
      int u = i * 5 + j;
      for (int dy = -1; dy <= 1; dy++) {
        for (int dx = -1; dx <= 1; dx++) {
          int y = i + dy, x = j + dx;
          if (0 <= y && y < 5 && 0 <= x && x < 5) {
            int v = y * 5 + x;
            edges[u].push_back(v);
          }
        }
      }
    }
  }

  for (int i = 0; i < 25; i++) {
    char c;
    cin >> c;
    board[i] = c - 'A';
    edges[25].push_back(i);
  }

  nodes[0].cnt = UINT16_MAX;
  cout << Find(25, 0, 0);

  return 0;
}